import styled from 'styled-components';

const Box = styled.p`   
    color: white;
    margin-top: 20px;
    padding: 5px 5px;
    border-radius: 10px;
    box-shadow: 0px 6px 4px rgba(0, 0, 0, 0.25);
    background-color: #f44336;
`;

export default Box;
